茨*前在澳大利亚接受采访时表示，**近几十年来*崛起是&ldquo;世界*巨大胜利&rdquo;。他还说，**如今在**上&ldquo;更为衰弱&rdquo;，像**这样*国家需要在世界治理中发挥更大*作用。 **福克斯商业网站称，盖茨是周一（23*）在澳大利亚智库洛伊国际政策研究所参加活动时发表上述言论*。当被问及对**有多&ldquo;看好&rdquo;时，他指出，**占据了全球人口数量*近20%，如今其在全球经济中*比重与其在全球人口中*比重完全匹配，&ldquo;我倾向于将**崛起视为世界*巨大胜利&rdquo;。 盖茨还称，**当前对***心态是一种&ldquo;双输心态&rdquo;，而**也对此给予相对*回应。他说：&ldquo;如果你问**政客，&lsquo;嘿，你希望**经济收缩20%还是增长20%&rsquo;？恐怕他们会投票支持&lsquo;是*，让我们去搞穷那些人&rsquo;，而不明白对于全球经济、癌症药物*发明、气候变化*解决来说，我们都休戚与共。&rdquo;','/555/coverImage/2023/01/27/1618910736292577280.jpeg',0,0,1,'2023-01-27 09:56:12','2023-01-27 09:56:12','2023-01-27 09:56:12',1,1),(1618942799544606720,1575444479153295360,'测试删除同步','😎 😁 **是很难的，那堆在广西北海驻扎的坑**滓耗得起时间。有时间的可以搞一下。 我在2020时候去过广西，当时到了北海打的士（别问为啥，问就是当时*风） **问**大哥哪里有好吃，接下来是标准剧情，对的，被坑了，也不多，就是几百块。 后面滴滴回去酒店，没*住问了滴滴**。 滴滴**这么和我说：&ldquo;我有常去的店，但我不能推荐你去，因为会坑你。我建议你也别问那些的士或者其他滴滴**，很大可能也会把你带去其他很差的店，你真的要去，去大众点评什么，或者去那个风情街，那个风情街之前被整顿了好多次，里面的都是比较规矩的，不会乱来，我建议去那里看看，别相信什么小店，都是坑人的。&rdquo; 结合最近看的三亚新闻，旅游城市的乱不是一年半年，更不要说刚**，何止是薅羊毛，直接把羊吃到骨头都没了。 作者：辉少**：https://*************/question/580710297/answer/2861955658来源：知乎著作*归作者所有。商业转载请**作者获得授*，非商业转载请注明出处。','/555/coverImage/2023/01/27/1618942799544606720.jpg',0,0,3,'2023-01-27 12:58:54','2023-01-27 12:03:37','2023-01-27 12:58:54',0,1),(1618962809390370816,1575444479153295360,'skjdfhjkdsf',' 需求的前提是抓痛点，痛点的前提是有痛感。一个人连痛感都没有，你告诉他背上有只老虎，让他掸一掸，他不觉得你更需要健康建议就不错了。在他们的认知里，你那个制氧机，就是用来掸老虎的拂尘，拿来打扫卫生都嫌不好用，没给你扔了就是单纯因为不想糟蹋东西，哪怕他们对这个东西的价值一无所知。 所以要想让他们用制氧机，就要用魔法打败魔法。比如告诉他们这个制氧机可以预防新冠，再比如说每吸氧多一小时，可以延长寿命25分钟，所以晚上睡觉挂机等于白捡寿命。把这个收益说得越简明越好，越快收效越好。 不要回避一个现实，就是缺乏认知的人倾向于短视，长期且抽象的收益对他们很难有吸引力。 作者：炸乎链接：https://***.zhihu.com/question/580774824/answer/2862429781来源：知乎著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。','/555/coverImage/2023/01/27/1618962809390370816.jpeg',0,0,1,'2023-01-27 13:23:07','2023-01-27 13:23:07','2023-01-27 13:23:07',0,1),(1618963929336741888,1575444479153295360,'会计师的地方',' 需求的前提是抓痛点，痛点的前提是有痛感。一个人连痛感都没有，你告诉他背上有只老虎，让他掸一掸，他不觉得你更需要健康建议就不错了。在他们的认知里，你那个制氧机，就是用来掸老虎的拂尘，拿来打扫卫生都嫌不好用，没给你扔了就是单纯因为不想糟蹋东西，哪怕他们对这个东西的价值一无所知。 所以要想让他们用制氧机，