羊吃到骨头都没了。</p>\n</div>\n<br>作者：辉少<br>**：https://*************/question/580710297/answer/2861955658<br>来源：知乎<br>著作*归作者所有。商业转载请**作者获得授*，非商业转载请注明出处。</div>','2023-01-27 20:03:36','2023-01-27 20:03:36',0),(1618962809390370816,'<div>\r\n<div>\r\n<p data-first-child=\"\" data-pid=\"Uy6Hk8V5\">需求的前提是抓痛点，痛点的前提是有痛感。一个人连痛感都没有，你告诉他背上有只老虎，让他掸一掸，他不觉得你更需要健康建议就不错了。在他们的认知里，你那个制氧机，就是用来掸老虎的拂尘，拿来打扫卫生都嫌不好用，没给你扔了就是单纯因为不想糟蹋东西，哪怕他们对这个东西的价值一无所知。</p>\r\n<p data-pid=\"wVVBdhxd\">所以要想让他们用制氧机，就要用魔法打败魔法。比如告诉他们这个制氧机可以预防新冠，再比如说每吸氧多一小时，可以延长寿命25分钟，所以晚上睡觉挂机等于白捡寿命。把这个收益说得越简明越好，越快收效越好。</p>\r\n<p data-pid=\"-M7jMVrU\">不要回避一个现实，就是缺乏认知的人倾向于短视，长期且抽象的收益对他们很难有吸引力。</p>\r\n</div>\r\n<br><br>作者：炸乎<br>链接：https://www.zhihu.com/question/580774824/answer/2862429781<br>来源：知乎<br>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>','2023-01-27 21:23:07','2023-01-27 21:23:07',0),(1618963929336741888,'<div>\r\n<div>\r\n<p data-first-child=\"\" data-pid=\"Uy6Hk8V5\">需求的前提是抓痛点，痛点的前提是有痛感。一个人连痛感都没有，你告诉他背上有只老虎，让他掸一掸，他不觉得你更需要健康建议就不错了。在他们的认知里，你那个制氧机，就是用来掸老虎的拂尘，拿来打扫卫生都嫌不好用，没给你扔了就是单纯因为不想糟蹋东西，哪怕他们对这个东西的价值一无所知。</p>\r\n<p data-pid=\"wVVBdhxd\">所以要想让他们用制氧机，就要用魔法打败魔法。比如告诉他们这个制氧机可以预防新冠，再比如说每吸氧多一小时，可以延长寿命25分钟，所以晚上睡觉挂机等于白捡寿命。把这个收益说得越简明越好，越快收效越好。</p>\r\n<p data-pid=\"-M7jMVrU\">不要回避一个现实，就是缺乏认知的人倾向于短视，长期且抽象的收益对他们很难有吸引力。</p>\r\n</div>\r\n<br><br>作者：炸乎<br>链接：https://www.zhihu.com/question/580774824/answer/2862429781<br>来源：知乎<br>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>','2023-01-27 21:27:34','2023-01-27 21:27:34',0),(1618964918424928256,'<p>士大夫士大夫是劳动法lsdf</p>\r\n<p>是看到就烦lskdf</p>','2023-01-27 21:31:30','2023-01-27 21:31:30',0),(1618966733073788928,'<p>士大夫酸辣粉胜多负少的咖啡机卡</p>','2023-01-27 21:38:43','2023-01-27 21:38:43',0),(1618967260654317568,'<p>士大夫就是懂法守法士大夫双方都速率快的附件</p>','2023-01-27 21:40:48','2023-01-27 21:40:48',0),(1618968138509512704,'<p>阿萨德阿萨德很骄傲卡复活akjf</p>','2023-01-27 21:44:18','2023-01-27 21:44:18',0),(1618968659412738048,'<p>的反抗灵魂石浪费肯德基slfslfj</p>','2023-01-27 21:46:22','2023-01-27 21:46:22',0),(1618969391083892736,'<p>的反抗灵魂石浪费肯德基slfslfj</p>','20