4500万欧元。</p>\r\n<p data-pid=\"V43dfMpr\">不会过人不会带球不会传球，踩个单车都能被日本后卫一脚断了，关键是还没有速度，但毕竟是马竞过来的神锋，恒大给了他无限信任，结果就是那年亚冠恒大作为卫冕冠军直接小组赛出局。</p>\r\n<p data-pid=\"i20POxFK\">所以那人后来有了个绰号&ldquo;水马&rdquo;。他是我见过的恒大最差引援，没有之一。</p>\r\n<p data-pid=\"QYk7HF8c\">C罗目前的能力，比水马好不了多少</p>\r\n</div>\r\n<br><br>作者：梅黑的爷爷<br>链接：https://www.zhihu.com/question/580842184/answer/2863340540<br>来源：知乎<br>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>','2023-01-28 20:03:20','2023-01-28 20:03:20',1),(1619308883875590144,'<p>风凉话监考老师地划分开始的福克斯</p>\r\n<p>as的空间哈萨克的骄傲和</p>','2023-01-28 20:18:17','2023-01-28 20:18:17',1),(1619311006533136384,'<p>爱神的箭看哈谁看得见哈克四朵金花a</p>\r\n<p>夹克衫打卡时接电话卡就收到货</p>\r\n<p>阿贾克斯打开手机红打卡机上党课</p>\r\n<p>阿斯加德哈克实践活动卡健身房</p>\r\n<p>阿克苏发货啦卡卡姐时刻计划&nbsp;</p>','2023-01-28 20:26:44','2023-01-28 20:26:44',1),(1619311740020436992,'<p>阿分手快乐回来看jl</p>\r\n<p>加首付卡卷啊上分很快</p>\r\n<p style=\"text-align: center;\"><sub>卡<strong><s><span style=\"text-decoration: underline;\"><em>扣伙食费卡金</em></span></s></strong>虎送福可交换</sub></p>\r\n<p style=\"text-align: center;\"><sub>奥斯卡黄发卡机数分课间</sub></p>\r\n<p style=\"text-align: center;\"><sub>😜</sub></p>','2023-01-28 20:29:38','2023-01-28 20:29:38',1),(1619644502795436032,'<p>暗示分离哈客服就会</p>\r\n<p>AK士大夫拉开&nbsp;</p>','2023-01-29 18:31:55','2023-01-29 18:31:55',0),(1620314106559578112,'<p>如今《<a class=\"RichContent-EntityWord css-pgtd2j\" href=\"https://www.zhihu.com/search?q=%E6%B5%81%E6%B5%AA%E5%9C%B0%E7%90%832&amp;search_source=Entity&amp;hybrid_search_source=Entity&amp;hybrid_search_extra=%7B%22sourceType%22%3A%22answer%22%2C%22sourceId%22%3A2868020103%7D\" target=\"_blank\" rel=\"noopener\" data-za-not-track-link=\"true\">流浪地球2</a>》火遍全网，电影中的核心科技，就是高速发展后的未来核工业，以至于不禁让人联想，如果人类真的失去太阳，地球真的需要流浪，核工业就是保持人类文明的基石。文明、地球、太阳、人类、电影</p>','2023-01-31 14:52:41','2023-01-31 14:52:41',0),(1620314287581544448,'<p>实，太阳里是存在一个自发的负反馈机制的，核聚变需要非常高的温度和压强才能发生，而太阳核心一直具备氢聚变的条件，在负反馈机制的限制下，可以让太阳物质的万有引力与氢聚变的能量释放刚好达到平衡，这就促使太阳在几十亿年来一直相对稳定。但是、</p>\n<p>氦聚变没有这样的负反馈机制，当氦在太阳引力的作用下向内收缩时，温度升高，但压强不变，直到温度高达一亿度，氦被点燃，聚变放出的能量让温度升得更高，让更多的氦聚变。也就是说，氦聚变只有正反馈，没有负反馈，最终会造成一场失控的爆炸，这就是氦闪。</p>\n<p>文明、地球、太阳、人类、电影</p>','2023-01-31 14:53:24','2023-01-31 14:53:24',0),(1620321986654289920,'<div>在以秒计的时间里，太阳核心的氦剧烈燃烧，产生的能量比平时高千亿倍，同时耗尽了太阳核心中的氢，并持续升高核心温度，导致核心边缘一层本来不能聚变的氢也开始发生聚变，让太阳急剧膨胀，甚至彻底占据了地球轨道。从居安思危的角度来看，这在很久以后的未来是有可能发生的，或许是几十亿年以后。虽然现在不用担心这个问题，</div>\n<div>但作为科幻电影，能够复现或者预测这个场景，也的确会带来更多对未来危机的思考。</div>\n<p>&nbsp;</p>','2023-01-31 15:24:00','2023-01-31 15:24:00',0),(1620324363797004288,'<p>奥斯卡第六届奥斯卡的骄傲了</p>\n<div>\n<div>《流浪地球2》中，人类计划给地球安装上万座巨大的行星发动机，推动地球离开太阳系，这些发动机就是重核聚变<a class=\"RichContent-EntityWord css-pgtd2j\" href=\"https://www.zhihu.com/search?q=%E8%A1%8C%E6%98%9F%E5%8F%91%E5%8A%A8%E6%9C%BA&amp;search_source=Entity&amp;hybrid_search_source=Entity&amp;hybrid_search_extra=%7B%22sourceType%22%3A%22answer%22%2C%22sourceId%22%3A2868020103%7D\" target=\"_blank\" rel=\"noopener\" data-za-not-track-link=\"true\">行星发动机</a>。可控核聚变并非奇思妙想，它正是目前世界最前沿的重大核科学研究，也是各国都在深入研究的大科学工程。影片中最引人注目的重核聚变行星发动机，全球布置上万台，每台发动机的高度比珠穆朗玛峰还高2.2公里，单台发动机能提供150亿吨的推力。</div>\n作者：中国核工业集团有限公司<br>链接：https://www.zhihu.com/question/581359988/answer/2868020103<br>来源：知乎<br>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>\n<div>在以秒计的时间里，太阳核心的氦剧烈燃烧，产生的能量比平时高千亿倍，同时耗尽了太阳核心中的氢，并持续升高核心温度，导致核心边缘一层本来不能聚变的氢也开始发生聚变，让太阳急剧膨胀，甚至彻底占据了地球轨道。从居安思危的角度来看，这在很久以后的未来是有可能发生的，或许是几十亿年以后。虽然现在不用担心这个问题，但作为科幻电影，能够复现或者预测这个场景，也的确会带来更多对未来危机的思考</div>','2023-01-31 15:33:27','2023-01-31 15:33:27',0),(1620325085330538496,'<p>🙄😡</p>\r\n<p>按时间发哈看世界复活卡上积分</p>','2023-01-31 15:36:19','2023-01-31 15:36:19',0),(1620327540009218048,'<div>在以秒计的时间里，太阳核心的氦剧烈燃烧，产生的能量比平时高千亿倍，同时耗尽了太阳核心中的氢，并持续升高核心温度，导致核心边缘一层本来不能聚变的氢也开始发生聚变，让太阳急剧膨胀，甚至彻底占据了地球轨道。从居安思危的角度来看，这在很久以后的未来是有可能发生的，或许是几十亿年以后。虽然现在不用担心这个问题，</div>\r\n<div>😇</div>\r\n<div>但作为科幻电影，能够复现或者预测这个场景，也的确会带来更多对未来危机的思考。</div>','2023-01-31 15:46:04','2023-01-31 15:46:04',0),(1620327828237594624,'<p>重核聚变是采用硅等元素作为聚变原料，首先要克服原子核之间的静电斥力，众所周知，越重的原子核所带电荷越多，越难以产生聚变。因此各国重点研究的可控核聚变均采用轻核聚变，即用氢的两个同位素&mdash;&mdash;氘和氚来进行研究。</p>','2023-01-31 15:47:13','2023-01-31 15:47:13',0),(1620327986748731392,'<p>发哈发课件暗黑风</p>\r\n<p>埃里克森符号兰蔻粉水拉开发</p>\r\n<p>来看说服力卡司法局连卡佛</p>\r\n<p>了看是否拉康师傅拉开犯傻联发科</p>\r\n<p>AK律师费拉克丝发挥了卡死发货啦开发</p>\r\n<p>拉拉手法拉康师傅赫拉开发克里斯发挥了洒咖啡</p>','2023-01-31 15:47:50','2023-01-31 15:47:50',0),(1620328155225534464,'<p>阿斯蒂芬has咖啡机哈开发</p>\r\n<p>按实际和反馈sjfhkajsfhkajfhj</p>\r\n<p>阿贾克斯发给卡健身房环境开发</p>\r\n<p>阿斯蒂芬哈卡复活卡卷返回空</p>\r\n<p>来看双方都拉康师傅里卡复活</p>\r\n<p>埃里克罗斯福号拉丝粉卡李开复</p>\r\n<div>\r\n<div>国际热核聚变实验堆（ITER）项目就是正在通过模拟太阳的核聚变反应，产生能量并实现可控利用。由中核集团牵头研发的中国新一代&ldquo;人造太阳&rdquo;装置（HL-2M）在2022年实现等离子体电流突破100万安培（1兆安），创造了中国可控核聚变装置运行新纪录，标志着我国核聚变研发距离聚变点火迈进重要一步，跻身国际第一方阵。因此，电影中展现中国牵头的行星发动机项目，正是建立在中国具有世界领先的核聚变实力基础之上，才显得真实可信。</div>\r\n<br><br>作者：中国核工业集团有限公司<br>链接：https://www.zhihu.com/question/581359988/answer/2868020103<br>来源：知乎<br>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</div>','2023-01-31 15:48:31','2023-01-31 15:48:31',0),(1620385596059541504,'<p>今天又是打代码的一天，真的好累。什么时候项目能上线🤓</p>','2023-01-31 19:36:46','2023-01-31 19:36:46',0),(1620385838091853824,'<p>打代码做开发真的好吗？今天又思考了这个问题</p>','2023-01-31 19:37:43','2023-01-31 19:37:43',0),(1620386550246907904,'<p>😚数据库电话费看世界后方可闪电发货奥斯卡开了多久阿斯拉达</p>','2023-01-31 19:40:33','2023-01-31 19:40:33',0),(1620386717213761536,'<p>士大夫看似简单废了空军说浪费</p>\r\n<p>里盛开的花发牢骚肯定发火</p>','2023-01-31 19:41:13','2023-01-31 19:41:13',0),(1620733888274436096,'<p>文档代码文档代码文档代码这些关键字还不行？</p>','2023-02-01 18:40:45','2023-02-01 18:40:45',0),(1620798036832165888,'<p>压缩图片成不成功啊</p>','2023-02-01 22:55:40','2023-02-01 22:55:40',0),(1620799484177420288,'<p>来个超大的图片，还不成功？</p>','2023-02-01 23:01:25','2023-02-01 23:01:25',0),(1620799929377624064,'<p>这个压缩的怎么样呢？</p>','2023-02-01 23:03:11','2023-02-01 23:03:11',0),(1620800975554482176,'<p>我抄压缩烦死了，敏感词嫖娼</p>','2023-02-01 23:07:20','2023-02-01 23:07:20',0),(1620801365251457024,'<p>这个压缩怎么样？？？</p>','2023-02-01 23:08:53','2023-02-01 23:08:53',0),(1620801675424432128,'<p>高清阿斯利康大富豪和阿奥斯卡发动机案例库</p>','2023-02-01 23:10:07','2023-02-01 23:10:07',0),(1620826324195606528,'<p>asdajsdlkajdkla</p>','2023-02-02 00:48:03','2023-02-02 00:48:03',0),(1620836935784738816,'<